import React from 'react';

export default class Calendar extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
       <iframe
       src='https://calendar.google.com/calendar/embed?height=600&amp;wkst=1&amp;bgcolor=%23ffffff&amp;ctz=America%2FDenver&amp;src=Y2l0YXRpb25uZXR3b3JrQGdtYWlsLmNvbQ&amp;src=YWRkcmVzc2Jvb2sjY29udGFjdHNAZ3JvdXAudi5jYWxlbmRhci5nb29nbGUuY29t&amp;src=ZW4udXNhI2hvbGlkYXlAZ3JvdXAudi5jYWxlbmRhci5nb29nbGUuY29t&amp;color=%23039BE5&amp;color=%2333B679&amp;color=%230B8043&amp;showDate=0&amp;showTitle=0&amp;showNav=1&amp;showTabs=0&amp;showPrint=1&amp;showCalendars=1&amp;showTz=1&amp;mode=AGENDA'
       width='1000'
       height='1200'
       frameborder='0'
       scrolling='no' />
     </div>
    );
  }
}
